    super(props)
    this.GetEvents = this.GetEvents.bind(this)
  }


  GetEvents() {
    let today = new Date()
    let oneWeek = new Date()
    oneWeek.setDate(oneWeek.getDate() + 6)
    fetch(`https://www.googleapis.com/calendar/v3/calendars/thdnkns@gmail.com/events?singleEvents=True&orderBy=startTime&timeMin=${today.toISOString()}&timeMax=${today.setDate(today.getDate() + 7).toISOString()}&key=AIzaSyDZgdchyvtfLwtT2s1JH5dxgnwd-2nI2dw`)
